import React from 'react';
import {Button} from "@nextui-org/react";

interface Props {
    children: React.ReactNode;
    color?: "primary" | "transparent" | "danger";
    className?: string;
}

function MyButton({children, className}: Props) {
    return (
        <Button className={`${className} rounded bg-[#1560BD] transition hover:bg-[#0f488e]`}>
            {children}
        </Button>
    );
}

export default MyButton;
